import React from 'react';

const UserItemsPage = () => {
    const [user, setUsers] = useState<IUser[]>([])

    useEffect(() => {
        fetchUsers()
    }, [])

    async function fetchUsers() {
        try {
            const res = await axios.get<IUser[]>('https://jsonplaceholder.typicode.com/users/')
            setUsers(res.data)
        } catch (e) {
            alert(e)
        }
    }

    return (
        <div>

        </div>
    );
};

export default UserItemsPage;
